import React, { Component } from 'react';
import { Link } from 'react-router-dom';
// import { getDetail } from './detailActions';

// export default class Result extends React.Component {
//     constructor(props) {
//         super(props);
//     }



    class BladeDetails extends Component {
        state = {
          blades: [],
        //   checkbox: false,
        }

        componentDidMount() {
          fetch('http://localhost:3000/api/blades?access_token=5e3600914e63efce06c8cee3')
            .then(res => res.json())
            .then((data) => {
              this.setState({ blades: data })
            })
            .catch(console.log)
        }





    // componentDidMount() {
    //     const { dispatch } = this.props;
    //     dispatch(getDetail(this.props.movieID));
    // }

    render() {

        const allKnivestrue = this.state.blades.filter(i => i.allKnives === true);
        const renderAllKnives = allKnivestrue.map((i) =>


        <table className='container tableBackground showStopper'>
        <thead>
        </thead>
        <tbody>
          <tr>
            <td className='show3'>{i.id}</td>
            <td className='show1 shane'>{i.brand}</td>
            <td className='show1 shane'>{i.model}</td>
            <td className='show1 shane'>{i.steel}</td>
            <td className='show1 shane'>${i.price}</td>

            <td className='show2 shane forSaleMargins'>
              <checkbox>
                <div class="checkbox-example checkMargins">
                  <input type="checkbox" value="1" id="checkboxOneInput" />
                  <label for="checkboxOneInput"></label>
                </div>
              </checkbox>


              {i.forSale}
            </td>


          </tr>
        </tbody>
      </table>
    );
        // const { movie } = this.props;
        return (
            <div className='container card mt-3 mb-3 p-0 space'>
                <div className='card-body'>
                    <div className='container'>
                        {renderAllKnives}
                        {/* <div className='row'>
                            <img className='detail col-5 mt-3 mb-3' src={i.brand}></img>
                            <div className='col-7 mt-3 mb-3'>
                                <h2 id='title'>{i.model}</h2>
                                <p>{i.price}</p>
                                <p>{i.steel}</p>
                                <hr></hr>
                                <p>{i.handleMaterial}</p>
                                <br></br>
                                <p>{i.bladeShape}</p>
                                <br></br>
                                {/* <h6 className='metascore'>Metascore: {movie.Metascore}/100</h6>
                                <h6>IMDB: {movie.imdbRating}/10</h6> */}
                                <Link className='dashboardLinkStyling' to='dashboard'>Return to Search</Link>
                            </div>
                        </div>
                    </div>
        )
    }
}

export default BladeDetails
